import React from "react";
import CatList from "./CatList";
import NavBar from "./NavBar";

function CatPage({ cats, setCats, setPage }) {

    const unMatchedCatArray = cats.filter((cat) => {
        if (cat.matchStatus === "null") {
            return cat
        }
    })

    function handleSearch(search) {
        const searchedArray = cats.filter((cat) => {
          if(cat.name.toLowerCase().includes(search.toLowerCase())) {
              return cat
            }
          })
          setCats(searchedArray)
        }

  return (
    <main>
        <NavBar handleSearch={handleSearch}onChangePage={setPage}/>
            <CatList 
                cats={unMatchedCatArray}
                setCats={setCats}
            />
    </main>
  );
}

export default CatPage;
